export default {
	//disable on true
	disableLoadASN: () => {
		var i = 0
		var currentSum = 0
		var inboundQty = 0
		for(let i = 0; i < appsmith.store.ASNFormatted.length; i++) {

			if (appsmith.store.ASNFormatted[i].inboundQuantity != null) {
				if (i > 0) {
					if (currentSum != inboundQty) {
						return true
					}	
				}
				currentSum = 0
				inboundQty = appsmith.store.ASNFormatted[i].inboundQuantity
			} 
			currentSum = currentSum + appsmith.store.ASNFormatted[i].plannedQuantity
		}
		if (currentSum != inboundQty) {
			return true
		}
		return false
	}
}
